import React from 'react';
import {ListGroup, ListGroupItem} from 'reactstrap';
const Menus = () => {

    return (
        <div>
            <ListGroup>
                <ListGroupItem tag="a" href="#" action>
                    Home
                </ListGroupItem>
                <ListGroupItem tag="a" href="#" action>
                    Add Course
                </ListGroupItem>
                <ListGroupItem tag="a" href="#" action>
                    View Courses
                </ListGroupItem>
            </ListGroup>
        </div>
    )
   
}

export default Menus;
